function secondsToTime(seconds) {
  const minutes = Math.floor(seconds / 60);
  const remainingSeconds = serialize(seconds % 60);

  const formattedMinutes = String(minutes).padStart(2, "0");
  const formattedSeconds = String(remainingSeconds).padStart(6, "0");

  return `${formattedMinutes}:${formattedSeconds}`;
}

function checkPlayerSector() {
  let players = room
    .getPlayerList()
    .filter((p) => room.getPlayerDiscProperties(p.id) != null);
  players.forEach((p) => {
    let name = p.name;
    playerList[name].sectorTime += 1 / 60;
    if (room.getScores().time > 0 && _Circuit) {
      if (
        playerList[name].sector == 1 &&
        _Circuit.MinX <= room.getPlayerDiscProperties(p.id).x &&
        room.getPlayerDiscProperties(p.id).x <= _Circuit.MaxX &&
        _Circuit.MinY <= room.getPlayerDiscProperties(p.id).y &&
        room.getPlayerDiscProperties(p.id).y <= _Circuit.MaxY
      ) {
        let sectorTime = parseFloat(playerList[name].sectorTime);
        room.sendAnnouncement(
          ` Setor 3/3 de ${name}: ${serialize(sectorTime)} segundos`,
          null,
          colors.lapTime,
          fonts.lapTime,
          sounds.lapTime
        );
        playerList[name].sector = 2;
        playerList[name].sectorTime = 0;
      } else if (
        playerList[name].sector == 2 &&
        _Circuit.MinO2X <= room.getPlayerDiscProperties(p.id).x &&
        room.getPlayerDiscProperties(p.id).x <= _Circuit.MaxO2X &&
        _Circuit.MinO2Y <= room.getPlayerDiscProperties(p.id).y &&
        room.getPlayerDiscProperties(p.id).y <= _Circuit.MaxO2Y
      ) {
        let sectorTime = parseFloat(playerList[name].sectorTime);
        room.sendAnnouncement(
          ` Setor 1/3 de ${name}: ${serialize(sectorTime)} segundos`,
          null,
          colors.lapTime,
          fonts.lapTime,
          sounds.lapTime
        );
        playerList[name].sector = 3;
        playerList[name].sectorTime = 0;
      } else if (
        playerList[name].sector == 3 &&
        _Circuit.MinO3X <= room.getPlayerDiscProperties(p.id).x &&
        room.getPlayerDiscProperties(p.id).x <= _Circuit.MaxO3X &&
        _Circuit.MinO3Y <= room.getPlayerDiscProperties(p.id).y &&
        room.getPlayerDiscProperties(p.id).y <= _Circuit.MaxO3Y
      ) {
        let sectorTime = parseFloat(playerList[name].sectorTime);
        room.sendAnnouncement(
          ` Setor 2/3 de ${name}: ${serialize(sectorTime)} segundos`,
          null,
          colors.lapTime,
          fonts.lapTime,
          sounds.lapTime
        );
        playerList[name].sector = 1;
        playerList[name].sectorTime = 0;
      }
    }
  });
}

