function collisionDetectionSegmentPlayer() {
  //This function must be handled in room.onGameTick() to get the true result.
  var players = room.getPlayerList();
  for (var i = 0; i < players.length; i++) {
    for (var j = 0; j < JMap.segments.length; j++) {
      if (players[i].team == 1) {
        var distancetov0 = pointDistance(
          room.getPlayerDiscProperties(players[i].id),
          JMap.vertexes[JMap.segments[j].v0]
        );
        var distancetov1 = pointDistance(
          room.getPlayerDiscProperties(players[i].id),
          JMap.vertexes[JMap.segments[j].v1]
        );
        var length = pointDistance(
          JMap.vertexes[JMap.segments[j].v0],
          JMap.vertexes[JMap.segments[j].v1]
        );
        var dot =
          ((players[i].position.x - JMap.vertexes[JMap.segments[j].v0].x) *
            (JMap.vertexes[JMap.segments[j].v1].x -
              JMap.vertexes[JMap.segments[j].v0].x) +
            (players[i].position.y - JMap.vertexes[JMap.segments[j].v0].y) *
              (JMap.vertexes[JMap.segments[j].v1].y -
                JMap.vertexes[JMap.segments[j].v0].y)) /
          Math.pow(length, 2);
        var closestX =
          JMap.vertexes[JMap.segments[j].v0].x +
          dot *
            (JMap.vertexes[JMap.segments[j].v1].x -
              JMap.vertexes[JMap.segments[j].v0].x);
        var closestY =
          JMap.vertexes[JMap.segments[j].v0].y +
          dot *
            (JMap.vertexes[JMap.segments[j].v1].y -
              JMap.vertexes[JMap.segments[j].v0].y);
        var closestPoint = { x: closestX, y: closestY };
        console.log(
          "distancetov0: " +
            distancetov0 +
            "\ndistancetov1: " +
            distancetov1 +
            "\nlength: " +
            length +
            "\ndot: " +
            dot +
            "\nclosestPoint: {" +
            closestPoint.x +
            "," +
            closestPoint.y +
            "}"
        ); //Before handling this function in room.onGameTick(), toggle this row in command line.

        if (
          pointDistance(closestPoint, JMap.vertexes[JMap.segments[j].v0]) +
            pointDistance(closestPoint, JMap.vertexes[JMap.segments[j].v1]) ==
          length
        ) {
          distX = closestX - players[i].position.x;
          distY = closestY - players[i].position.y;
          var distancetosegment = Math.sqrt(
            Math.pow(distX, 2) + Math.pow(distY, 2)
          );

          if (
            0 <=
            Math.hypot(
              room.getPlayerDiscProperties(players[i].id).xspeed,
              room.getPlayerDiscProperties(players[i].id).yspeed
            )
          ) {
            if (
              (JMap.segments[j].cMask != undefined &&
                JMap.segments[j].cMask.includes("red") == true &&
                JMap.segments[j].bCoef != undefined &&
                JMap.segments[j].curve == undefined) ||
              (JMap.segments[j].curve != undefined &&
                JMap.segments[j].curve == 0)
            ) {
              //Red team collision condition for parkour maps
              if (
                distancetosegment <=
                room.getPlayerDiscProperties(players[i].id).radius + 0.01
              ) {
                //0.01 is the tolerance
                if (room.getPlayerDiscProperties(players[i].id) != null) {
                  console.log(
                    new Date().getHours() +
                      ":" +
                      new Date().getMinutes() +
                      ":" +
                      new Date().getSeconds() +
                      "." +
                      new Date().getMilliseconds() +
                      "  " +
                      players[i].name +
                      " has collided with the point {" +
                      closestX +
                      "," +
                      closestY +
                      "} located on a wall on the point {" +
                      room.getPlayerDiscProperties(players[i].id).x +
                      "," +
                      room.getPlayerDiscProperties(players[i].id).y +
                      "}."
                  );
                }
              }
            }
          }
        }
      }
    }
  }
}

room.onGamePaused = function (byPlayer) {};

room.onGameStart = function (byPlayer) {
  byPlayer == null
    ? console.log(`Game started`)
    : console.log(`Game started by ${byPlayer.name}`);
  // positions = [];
  generalSafetyCar = false;
  camId = null;
  currentTime = 0;
  var players = room.getPlayerList();
  players.forEach((p) => {
    playerList[p.name].currentLap = 0;
    playerList[p.name].lapChanged = false;
    playerList[p.name].drsChanged = false;
    playerList[p.name].inSafetyCar = false;
    playerList[p.name].sector = 1;
    playerList[p.name].sectorTime = 0;
    for (let i = 0; i < limit; i++) {
      playerList[p.name].lapTimes.push(0);
    }
  });
};

room.onGameStop = function (byPlayer) {
  byPlayer == null
    ? console.log(`Game stopped`)
    : console.log(`Game stopped by ${byPlayer.name}`);
  generalSafetyCar = false;
  camId = null;
  currentTime = 0;
  let players = room.getPlayerList();
  players.forEach((p) => {
    playerList[p.name].currentLap = 0;
    playerList[p.name].lapChanged = false;
    playerList[p.name].drsChanged = false;
    playerList[p.name].inSafetyCar = false;
    playerList[p.name].lapTimes = [];
    playerList[p.name].sector = 1;
    playerList[p.name].sectorTime = 0;
  });
};

room.onGameTick = function () {
  checkPlayerLaps();
  checkPlayerSector();
  endRaceSession();
  currentTime += 1 / 60;
  // collisionDetectionSegmentPlayer();
  runCamera();
};

