room.onPlayerChat = function (player, message) {
  if (player.admin == true) {
    if (message.toLowerCase().split(" ")[0] == commands.admin) {
      room.setPlayerAdmin(player.id, !player.admin);
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.commands) {
      room.sendAnnouncement(
        "Available commands: !circuit [ID], !discord, !help, !map, !maps",
        player.id,
        colors.commands,
        fonts.commands,
        sounds.commands
      );
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.discord) {
      room.sendAnnouncement(
        "Entre no nosso Discord e venha participar da Frmula TOH!",
        null,
        colors.info,
        "bold",
        sounds.info
      );
      room.sendAnnouncement(
        "Link: https://discord.gg/cu7keKJP",
        null,
        colors.info,
        "normal",
        sounds.info
      );
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.endurance) {
      isEndurance = !isEndurance;
      room.sendAnnouncement(
        `Modo endurance ajustado para ${isEndurance} por ${player.name}`,
        null,
        colors.info,
        "normal",
        sounds.info
      );
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.laps) {
      let number = message.toLowerCase().split(" ")[1];
      if (number >= 1) {
        limit = number;
        var players = room.getPlayerList();
        players.forEach((p) => {
          for (let i = 0; i < limit - playerList[p.name].currentLap; i++) {
            playerList[p.name].lapTimes.push(0);
          }
        });
        room.sendAnnouncement(
          `Nmero de voltas ajustado para ${limit} por ${player.name}`,
          null,
          colors.info,
          "normal",
          sounds.info
        );
      } else {
        room.sendAnnouncement(
          `Nmero invlido de voltas`,
          player.id,
          colors.mapLoadDeny,
          fonts.mapLoadDeny,
          sounds.mapLoadDeny
        );
      }
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.mapInfo) {
      room.sendAnnouncement(
        `${_Circuit.Name} best lap: ${serialize(
          _Circuit.BestTime[0]
        )} seconds by ${_Circuit.BestTime[1]}`,
        player.id,
        colors.mapInfo,
        fonts.mapInfo,
        sounds.mapInfo
      );
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.mapLoad) {
      var id = message.toLowerCase().split(" ")[1];

      if (id < 1 || id > _Circuits.length) {
        room.sendAnnouncement(
          `Invalid ID`,
          player.id,
          colors.mapLoadDeny,
          fonts.mapLoadDeny,
          sounds.mapLoadDeny
        );
      } else {
        room.setCustomStadium(Circuits[id - 1]);
        room.sendAnnouncement(
          `${_Circuits[id - 1].Name} was loaded by ${player.name}`,
          null,
          colors.mapLoad,
          fonts.mapLoad,
          sounds.mapLoad
        );
        currentCircuit = id;
        JMap = JSON.parse(Circuits[id - 1]);
      }

      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.maps) {
      room.sendAnnouncement(
        `Map list below:\n${_Circuits
          .map((c) => c.Name + " [" + c.ID + "]")
          .join("\n")}`,
        player.id,
        colors.info,
        fonts.info,
        sounds.info
      );
      return false;
    }
    // else if(message.toLowerCase().split(" ")[0] == commands.qualy){
    //     if(sendRecWebhookURL != ""){
    //       		room.startRecording();
    //        	room.sendAnnouncement("Voc pode assistir o replay da sua qualificatria no Discord",player.id,colors.info,"bold",sounds.info);
    //    	}
    //     return false;
    // }
    else if (message.toLowerCase() == commands.safetyoff) {
      generalSafetyCar = false;
      room.sendAnnouncement(
        ` ALERTA DE SAFETY CAR!! `,
        null,
        0x00ff00,
        "bold",
        sounds.safety
      );
      room.sendAnnouncement(
        ` O Safety Car est DESLIGADO `,
        null,
        0x00ff00,
        "bold",
        sounds.safety
      );

      return false;
    } else if (message.toLowerCase() == commands.safetyon) {
      generalSafetyCar = true;
      limit = parseInt(limit) + 1;
      room.sendAnnouncement(
        ` ALERTA DE SAFETY CAR!! `,
        null,
        0xffff00,
        "bold",
        sounds.safety
      );
      room.sendAnnouncement(
        ` O Safety Car est LIGADO `,
        null,
        0xffff00,
        "bold",
        sounds.safety
      );
      var players = room.getPlayerList();
      players.forEach((p) => {
        for (let i = 0; i < limit - playerList[p.name].currentLap; i++) {
          playerList[p.name].lapTimes.push(0);
        }
      });

      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.speed) {
      playerList[player.name].speedEnabled =
        !playerList[player.name].speedEnabled;
      // room.sendAnnouncement(`Speed is turned ${speedEnableChanges[Number(playerList[player.name].speedEnabled)]}`,player.id,colors.speed,fonts.speed,sounds.speed);
      return false;
    }
  } else {
    if (message.toLowerCase().split(" ")[0] == commands.admin) {
      room.setPlayerAdmin(player.id, !player.admin);
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.commands) {
      room.sendAnnouncement(
        "Available commands: !commands, !map, !speed",
        player.id,
        colors.commands,
        fonts.commands,
        sounds.commands
      );
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.discord) {
      room.sendAnnouncement(
        "Entre no nosso Discord e venha participar da Frmula TOH!",
        player.id,
        colors.info,
        "bold",
        sounds.info
      );
      room.sendAnnouncement(
        "Link: https://discord.gg/tUS332xC",
        player.id,
        colors.info,
        "normal",
        sounds.info
      );
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.mapInfo) {
      room.sendAnnouncement(
        `${_Circuit.Name} best lap: ${serialize(
          _Circuit.BestTime[0]
        )} seconds by ${_Circuit.BestTime[1]}`,
        player.id,
        colors.mapInfo,
        fonts.mapInfo,
        sounds.mapInfo
      );
      return false;
    } else if (message.toLowerCase().split(" ")[0] == commands.speed) {
      playerList[player.name].speedEnabled =
        !playerList[player.name].speedEnabled;
      // room.sendAnnouncement(`Speed is turned ${speedEnableChanges[Number(playerList[player.name].speedEnabled)]}`,player.id,colors.speed,fonts.speed,sounds.speed);
      return false;
    }
  }
};

room.onPlayerKicked = function (kickedPlayer, reason, ban, byPlayer) {
  byPlayer == null
    ? console.log(
        `${kickedPlayer.name} ${playerKicked[Number(ban)]} (${reason})`
      )
    : console.log(
        `${kickedPlayer.name} ${playerKicked[Number(ban)]} by ${
          byPlayer.name
        } (${reason})`
      );
};

room.onPlayerJoin = function (player) {
  console.log(`${player.name} has joined`);
  let players = room.getPlayerList();

  let lapTimes = [];
  for (let i = 0; i < limit; i++) {
    lapTimes.push(0);
  }

  playerList[player.name] = {
    name: player.name,
    id: player.id,
    currentLap: 0,
    lapChanged: false,
    delta: 0,
    drsChanged: false,
    lapTimes: lapTimes,
    speedEnabled: false,
    inSafetyCar: false,
    isInTheRoom: true,
    isInTheTrack: false,
    sector: 1,
    sectorTime: 0,
  };

  if (room.getScores() == null && players.length == 1) {
    if (_Circuit.Team != 0) room.setPlayerTeam(player.id, _Circuit.Team);

    room.startGame();
  }
};

room.onPlayerLeave = function (player) {
  console.log(`${player.name} has left`);
  let players = room.getPlayerList();

  playerList[player.name].currentLap = 0;
  playerList[player.name].lapChanged = false;
  playerList[player.name].drsChanged = false;
  playerList[player.name].inSafetyCar = false;
  playerList[player.name].isInTheRoom = false;
  playerList[player.name].isInTheTrack = false;

  if (room.getScores() != null && players.length == 0) {
    room.stopGame();
  }
};

room.onPlayerTeamChange = function (changedPlayer, byPlayer) {
  byPlayer == null
    ? console.log(
        `${changedPlayer.name} was moved to ${teams[changedPlayer.team]}`
      )
    : console.log(
        `${changedPlayer.name} was moved to ${teams[changedPlayer.team]} by ${
          byPlayer.name
        }`
      );
  console.log(changedPlayer);
  if (changedPlayer.team != 0) {
    playerList[changedPlayer.name].isInTheTrack = true;
  } else {
    playerList[changedPlayer.name].isInTheTrack = false;
  }
  // changedPlayer.team != 0 ? playerList[changedPlayer.name].isInTheTrack = false : playerList[changedPlayer.name].isInTheTrack = true;
  playerList[changedPlayer.name].currentLap = 0;
  playerList[changedPlayer.name].lapChanged = false;
};

room.onPositionsReset = function () {
  let players = room.getPlayerList();
  players.forEach((p) => {
    playerList[p.name].currentLap = 0;
    playerList[p.name].lapChanged = false;
    for (let l = 0; l < playerList[p.name].lapTimes.length; l++) {
      playerList[p.name].lapTimes[l] = 0;
    }
  });
};

room.onRoomLink = function (url) {
  if (isRoomSet == false) {
    console.log(`Room set with url: ${url}`);
    isRoomSet = true;
  }
};

room.onStadiumChange = function (newStadiumName, byPlayer) {
  byPlayer == null
    ? console.log(`${newStadiumName} was loaded`)
    : console.log(`${newStadiumName} was loaded by ${byPlayer.name}`);

  let c = _Circuits.find((x) => x.Name == newStadiumName);
  let players = room.getPlayerList();
  let admins = room.getPlayerList().filter((p) => p.admin == true);

  players.forEach((p) => room.setPlayerTeam(p.id, c.Team));

  if (byPlayer == null) {
    if (c) {
      _Circuit = {
        MinX: c.MinX,
        MaxX: c.MaxX,
        MinY: c.MinY,
        MaxY: c.MaxY,
        MinO2X: c.MinO2X,
        MaxO2X: c.MaxO2X,
        MinO2Y: c.MinO2Y,
        MaxO2Y: c.MaxO2Y,
        MinO3X: c.MinO3X,
        MaxO3X: c.MaxO3X,
        MinO3Y: c.MinO3Y,
        MaxO3Y: c.MaxO3Y,
        DriveDirection: c.DriveDirection,
        StartDirection: c.StartDirection,
        Name: c.Name,
        BestTime: [c.BestTime[0], c.BestTime[1]],
        MainColor: c.MainColor,
        AvatarColor: c.AvatarColor,
        Angle: c.Angle,
        Team: c.Team,
        Limit: c.Limit,
        ID: c.ID,
      };
      limit = c.Limit ? c.Limit : 10;
      room.setTeamColors(c.Team, c.Angle, c.AvatarColor, c.MainColor);
    } else {
      admins.length > 0
        ? admins.forEach((p) =>
            room.sendAnnouncement(
              `Something went wrong with map ${newStadiumName}. Please try again!`,
              p.id,
              colors.mapChangeWrongName,
              fonts.mapChangeWrongName,
              sounds.mapChangeWrongName
            )
          )
        : room.sendAnnouncement(
            `Something went wrong with map ${newStadiumName}. Please call an admin to try again!`,
            null,
            colors.mapChangeWrongName,
            fonts.mapChangeWrongName,
            sounds.mapChangeWrongName
          );
    }
  } else {
    room.sendAnnouncement(
      "You don't have authorization to change maps in this room!",
      byPlayer.id,
      colors.mapChangeDeny,
      fonts.mapChangeDeny,
      sounds.mapChangeDeny
    );
    room.setCustomStadium(Circuits[0]);
  }
};
